import React from "react";

const SingleFriend = (props) => {
  let oneFriend = props.friend;
  return (
    <div className="card col-md-3" key={oneFriend.id}>
      <img src={oneFriend.photoImage} className="card-img-top" alt="..." />
      <div className="card-body">
        <h5 className="card-title">{oneFriend.title}</h5>
        <p className="card-text">{oneFriend.summary}</p>
        <div className="d-grid gap-2 d-md-flex">
          <button
            className="btn  btn-danger"
            type="button"
            onClick={this.onDeleteClick}
            data-friend-id={oneFriend.id}
          >
            Delete
          </button>
          <button
            className="btn btn-primary"
            type="button"
            onClick={this.onEditClick}
            data-friend-id={oneFriend.id}
          >
            Edit
          </button>
        </div>
      </div>
    </div>
  );
};

export default SingleFriend;
